import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  console.log(props);
  return props.items.map((ExpItem) => {
    <ExpenseItem
      title={ExpItem[0].title}
      amount={ExpItem[0].amount}
      date={ExpItem[0].date}
    />;
  });
}

export default Expenses;
